package com.retailstore.discountservice.model;import com.retailstore.discountservice.constant.UserType;import jakarta.persistence.*;import lombok.*;import org.springframework.data.annotation.CreatedDate;import org.springframework.data.jpa.domain.support.AuditingEntityListener;import java.time.LocalDateTime;import java.util.List;@Entity@Getter@Setter@NoArgsConstructor@AllArgsConstructor@EntityListeners(AuditingEntityListener.class)public class User {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Column(unique = true)    private String username;    @ElementCollection    @CollectionTable(name = "user_type", joinColumns = @JoinColumn(name = "user_id"))    private List<UserType> userTypes;    @CreatedDate    private LocalDateTime createdDate;}